INSERT INTO `candidates` (`id`, `name`, `avatar`, `description`) VALUES
(4, 'Harry Potter', 'wladimir.jpg', 'Gościu od gazu. Władimir Władimirowicz Putin, ros. Влади́мир Влади́мирович Пу́тин, wym. – rosyjski polityk, działacz państwowy i funkcjonariusz służb specjalnych, prezydent Federacji Rosyjskiej w latach 2000–2008 i od 2012; wcześniej premier Rosji. Z wykształcenia prawnik.'),
(5, 'Abraham Lincoln', 'lincoln.jpg', 'Amerykański polityk, szesnasty prezydent Stanów Zjednoczonych, uczestnik wojny Czarnego Jastrzębia. Zasiadał przez dwa lata jako przedstawiciel Partii Wigów w Izbie Reprezentantów.'),
(6, 'Leonardo da Vinci', 'leonardo.jpg', 'Włoski renesansowy artysta i uczony: malarz, rzeźbiarz, architekt, inżynier, a także odkrywca, matematyk, anatom, wynalazca, geolog, filozof, muzyk, pisarz. Leonardo często był opisywany jako archetyp „człowieka renesansu”'),
(7, 'Geralt z Rivii', 'geralt.jpg', 'Geralt z Rivii herbu Most, zwany Białym Wilkiem lub Rzeźnikiem z Blaviken – wiedźmin Cechu Wilka, pasowany na lyrijskiego rycerza, ochroniarz i zausznik temerskiego króla Foltesta, właściciel winnicy Corvo Bianco, oraz pięściarz i mistrz gwinta. Jedna z centralnych postaci historii XIII wieku oraz bohater niezliczonych legend. '),
(8, 'Bob Marley', 'bob.jpg', 'Jamajski wokalista, wykonawca muzyki reggae, zaś w początkowym etapie kariery – ska i rocksteady; współzałożyciel, główny wokalista i gitarzysta rytmiczny grupy The Wailers.'),
(9, 'Walter White', 'walter.jpg', 'Znany również pod swoim tajnym pseudonimem i pseudonimem biznesowym Heisenberg, a także często określany jako Mr. White, to były chemik i główny dystrybutor narkotyków z Albuquerque w Nowym Meksyku, którego imperium narkotykowe stało się największą operacją związaną z metamfetaminą w historii USA, przewyższając zarówno imperium Gustavo Fringa, jak i imperium kartelu.'),
(10, 'Neo', 'neo.jpg', 'Pracownik biurowy amerykańskiej firmy informatycznej, prowadzi podwójne życie. Na co dzień jest uczciwym obywatelem, który pracuje jako programista dla „szanowanej firmy programistycznej” Metacortex. Ale w nocy zamienia się w hakera, który pod pseudonimem „Neo” nielegalnie penetruje systemy komputerowe w celu kradzieży informacji. '),
(11, 'Jack Sparrow', 'jack.jpg', 'Legendarny pirat Siedmiu Mórz, Członek Trybunału Braci oraz Pirackich Lordów Siedmiu Mórz.');
